import axios from "axios";

export const getReplyFromQn = async (qn: string) => {
  const data = await axios.post("http://127.0.0.1:5000/api", {
    prompt:
      "Ingredients: Steak, butter\n" +
      "Ingredients: Tomato, Chicken\n" +
      "Ingredients: Pork, celery",
  });
  console.log(data);
};
